def is_prime(n):
    if n == 1:
        return False
    for i in range(2, n):
        if n % i == 0:
            return False
    return True

def sum_of_primes(n, m):
    sum = 0
    for i in range(n, m):
        if is_prime(i):
            sum += i
    return sum

print(sum_of_primes(10, 20))

